package cv64.jsp.taglib;import javax.servlet.jsp.JspWriter;import javax.servlet.jsp.tagext.TagSupport;import java.io.IOException;public class ExampleTag extends TagSupport {	public int doStartTag() {		try {			JspWriter out = pageContext.getOut();			out.println("Custom tag example ");		} catch (IOException exception) {			System.err.println("Error in ExampleTag");		}		return(SKIP_BODY);	}}